import TaskList from './components/TaskList';
import { useState } from "react";
import './App.css';

function App() {

  const [listState, setListState] = useState([{"name": "Tasks", "tasks": ["task 1", "task 2"]}])

  return (
    <div>
      {listState.map(list => {
        <TaskList name={list.name} tasks={list.tasks} />
      })}
      <button onClick={setListState([...listState, {"name": "Default name", "tasks": []}])}>Add new list</button>
    </div>
  );
}

export default App;
